import RDSMonitor from './components/RDSMonitor'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>
          <li><a href='#'>Account1</a></li>
          <li><a href='#'>Account2</a></li>
          <li><a href='#'>Account3</a></li>
        </ul>
      </header>
      <div>
        <RDSMonitor account_name="account1"></RDSMonitor>
      </div>
    </div>
  );
}

export default App;
